import React from "react";
import { Link } from "react-router-dom";


const Nav = () => {
  return (
    <div className="nav-bar">
      <Route>
      <Link className="home-link" to="/">Home</Link>
      <Link className="winners-link" to="/">Winners</Link>
      <Link className="vote-link" to="/">Start</Link>
      </Route>
    </div>
  );
};

export default Nav;
